 som taler for og de som taler mot de to\u003cbr\u003ealternativene til skattegrunnlag, er gruppen kommet til at\u003cbr\u003enettoinntekt fortsatt b\u00f8r gjelde som skattegrunnlag i\u003cbr\u003ebedriftsbeskatningen\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_moment_1640\u003cbr\u003etype: usage\u003c/p\u003e", "x": -110.1430152883207, "y": -185.9560016235335}, {"color": "#377eb8", "id": "2012-2019_moment_529", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eHun mener at lagmannsrettens straffutm\u00e5ling i utgangspunkt\u003cbr\u003eligger p\u00e5 et riktig niv\u00e5, men at det er \u003cb\u003emomenter\u003c/b\u003e som tilsier at\u003cbr\u003estraffen b\u00f8r settes noe ned.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_moment_529\u003cbr\u003etype: usage\u003c/p\u003e", "x": -355.5498298910097, "y": -103.34057835125395}, {"color": "#377eb8", "id": "1980-1990_moment_1632", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet b\u00f8r ved utformingen av de naermere regler dessuten tas\u003cbr\u003ehensyn til at behovet for velferdspermisjon i slike tilfelle vil vaere\u003cbr\u003emindre ved innf\u00f8ring av den foresl\u00e5tte differensierte\u003cbr\u003efullbyrdelsesmodell. Velferdsgrunner som nevnt, vil vaere vikti\u003cb\u003ege\u003cbr\u003emomen\u003c/b\u003eter for \u00e5 overf\u00f8re fangen til mindre restriktive\u003cbr\u003efullbyrdelsesalternativer, se naermere kap. 9.2. I endel spesielle\u003cbr\u003etilfelle b\u00f8r velferdspermisjon etter Utvalgets oppfatning normalt ikke\u003cbr\u003egis, enten det er tale om slik velferdspermisjon som fangen etter\u003cbr\u003ereglene har rett til, eller det er tale om slik velferdspermisjon som\u003cbr\u003ekan tilstas etter fengselsmyndighetenes skj\u003cspan style=\"color:#808080;\"\u003e\u00f8nn.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_moment_1632\u003cbr\u003etype: usage\u003c/p\u003e", "x": -16.95129925467832, "y": -46.230944187706534}, {"color": "#377eb8", "id": "1980-1990_moment_103", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eNedenfor nevnes noen av \u003cb\u003emomentene\u003c/b\u003e ved vurderingen.\u003cbr\u003eStraffeloven \u00a7 211 er en rettslig standard.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_moment_103\u003cbr\u003etype: usage\u003c/p\u003e", "x": -293.7010100631287, "y": 135.94070328304485}, {"color": "#377eb8", "id": "2012-2019_moment_2108", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eN\u00e5 m\u00e5 vi bli mye mer direkte i stilen og f\u00e5 ballen opp p\u00e5\u003cbr\u003emotstandernes halvdel, sier briten. Han peker ogs\u00e5 p\u00e5 omstendighetene\u003cbr\u003en\u00e5r han skal forklare hvorfor han ikke har lyktes med stilen og\u003cbr\u003efilosofien han egentlig forfekter. \u2013 Det har ikke vaert lett \u00e5 f\u00e5\u003cbr\u003estabilitet i laget. N\u00e5 skal alle vaere hundre prosent klare til neste\u003cbr\u003ekamp og vi vet hva vi har \u00e5 velge i. Det har blitt for mye triksing og\u003cbr\u003ebruk av folk utenfor sine vante roller. Det er det slutt p\u00e5 n\u00e5, sl\u00e5r\u003cbr\u003ehan fast. Burchnall har ogs\u00e5 klare roller og enklere oppgaver som\u003cbr\u003ee\u003cb\u003et mome\u003c/b\u003en\u003cspan style=\"color:#808080;\"\u003et.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_moment_2108\u003cbr\u003etype: usage\u003c/p\u003e", "x": -113.73133340962066, "y": 205.09150120212163}, {"color": "#377eb8", "id": "2012-2019_moment_734", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eEtt \u003cb\u003emoment\u003c/b\u003e i regjeringens forslag er at terskelen senkes\u003cbr\u003efor hvor langt en person m\u00e5 vaere kommet i forberedelsene av\u003cbr\u003eterrorhandlinger f\u00f8r straffansvar inntrer\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_moment_734\u003cbr\u003etype: usage\u003c/p\u003e", "x": 132.91020501392705, "y": -194.96814810574824}, {"color": "#377eb8", "id": "1980-1990_moment_775", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOgs\u00e5 for arbeidsmarkedsforskningen vil det vaere naturlig \u00e5\u003cbr\u003etillegge disse\u003cb\u003e momente\u003c/b\u003er vekt\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_moment_775\u003cbr\u003etype: usage\u003c/p\u003e", "x": -103.85884799775474, "y": -17.103275970349475}, {"color": "#377eb8", "id": "1980-1990_moment_492", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet at en del hushold ikke flytter til sentraliseringsregionene\u003cbr\u003eer \u00e5penbert et \u003cb\u003emoment\u003c/b\u003e.\u003cspan style=\"color:#808080;\"\u hjelp av denne retorikken makter han \u00e5 skape et\u003cbr\u003e\u003cb\u003emoment\u003c/b\u003e for erkjennelse og innsats.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_moment_1931\u003cbr\u003etype: usage\u003c/p\u003e", "x": -221.83930088678846, "y": -143.88115161650467}, {"color": "#377eb8", "id": "2012-2019_moment_1636", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet samme sier forsvarsminister Ine Eriksen S\u00f8reide (H). Men\u003cbr\u003ehun legger konsekvent til ett \u003cb\u003emoment\u003c/b\u003e til: Vi har sett at\u003cbr\u003eintensjonen kan endre seg meget raskt.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_moment_1636\u003cbr\u003etype: usage\u003c/p\u003e", "x": -29.030462290894363, "y": -277.29254241182247}, {"color": "#377eb8", "id": "1980-1990_moment_1243", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eI sin omtale av naeringskombinasjoner trekker\u003cbr\u003eSamekulturutvalget fram et nytt\u003cb\u003e momen\u003c/b\u003et i diskusjonen om \u00e5\u003cbr\u003ebevare bosettingen (NOU 1985:14, s.106): \u00abKombinasjonen fiske/sm\u00e5bruk\u003cbr\u003ehar g\u00e5tt en del tilbake etter krigen, og spesialisering i\u003cbr\u003enaeringslivet gj\u00f8r seg delvis gjeldende ogs\u00e5 he\u003cspan style=\"color:#808080;\"\u003er.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_moment_1243\u003cbr\u003etype: usage\u003c/p\u003e", "x": -204.88737628504484, "y": 53.91890181643935}, {"color": "#377eb8", "id": "1980-1990_moment_839", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eFor s\u00e5 vidt gjelder det sistnevnte \u003cb\u003emoment\u003c/b\u003e peker Utvalget\u003cbr\u003ep\u00e5 reglene i U \u00a7 105, som ved henvisningen til U \u00a7 98 bl. a. p\u00e5legger\u003cbr\u003eforretningsf\u00f8rer og styremedlem i sammenslutninger plikt til \u00e5 gi de\u003cbr\u003en\u00f8dvendige opplysninger til boet. Man har imidlertid ikke funnet disse\u003cbr\u003eargumenter avgj\u00f8rende.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 1980\u003cbr\u003egrouping: 1980-1990\u003cbr\u003eidentifier: 1980-1990_moment_839\u003cbr\u003etype: usage\u003c/p\u003e", "x": -10.297187584824282, "y": 96.48136708807792}, {"color": "#377eb8", "id": "2012-2019_moment_296", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDersom dette hadde vaert et viktig\u003cb\u003e momen\u003c/b\u003et i\u003cbr\u003eetterforskningen, og p\u00e5pekt i dokumentene, er det opplagt at politiet\u003cbr\u003eville tatt opp dette med NFF. Det har de ikke gjort, understreker\u003cbr\u003ekommunikasjonsdirekt\u00f8ren\u003cspan style=\"color:#808080;\"\u003e.\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_moment_296\u003cbr\u003etype: usage\u003c/p\u003e", "x": 76.20924673178159, "y": -118.80937284262973}, {"color": "#377eb8", "id": "2012-2019_moment_1438", "label": "0", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eDet \u00e5 plutselig ha et ekstra usikkert \u003cb\u003emoment\u003c/b\u003e rundt seg \u2014\u003cbr\u003esin egen kropp \u2014 som man ikke forst\u00e5r eller kan forutse, vil skape\u003cbr\u00 ent_2591\u003cbr\u003etype: usage\u003c/p\u003e", "x": 587.7852499584131, "y": 694.1299051862181}, {"color": "#4daf4a", "id": "2012-2019_moment_2849", "label": "2", "physics": false, "shape": "circle", "size": 10, "title": "\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003eOg for en bil som har lagt vekt p\u00e5 \u00e5 se litt annerledes ut, er\u003cbr\u003eogs\u00e5 firehjulstrekket i stil med dette. Firehjulstrekkeren Prius,\u003cbr\u003eutviklet og tilpasset i samarbeid med Toyota Norge, har f\u00e5tt en\u003cbr\u003ekompakt og lett el-motor p\u00e5 bakakselen som er spesialutviklet for \u00e5\u003cbr\u003eyte med h\u00f8yt \u003cb\u003emoment\u003c/b\u003e i lav fart.\u003cspan style=\"color:#808080;\"\u003e\u003c/span\u003e\u003cp style=\"font-size:8px;\"\u003e\u003cbr\u003edate: 2012\u003cbr\u003egrouping: 2012-2019\u003cbr\u003eidentifier: 2012-2019_moment_2849\u003cbr\u003etype: usage\u003c/p\u003e", "x": 750.0, "y": -40.0013184216509}]);
